window.bookSummaryJSON = "<p>Can a secret runic message lead to murder?</p> <p>As Lucy and Rafe plan their wedding, everyone wants to get involved. The vampire knitting club are crafting the gown, William's catering, the Miss Watts are making the cake. Everything's under control. Or is it? Just as Lucy begins to believe there won't be a hitch in their plans, she receives a curious wedding gift that leads to murder.</p> <p>Between hen parties, her parents arriving early, running a knitting shop, and a murder, will Lucy make it down the aisle in one piece?</p> <p>Join Lucy and her undead knitting club as they solve another crime.</p>"; 
